CREATE TABLE IF NOT EXISTS industry_master (business_id VARCHAR(64) PRIMARY KEY, name VARCHAR(255), category_code VARCHAR(64), category_path TEXT, algorithm_type VARCHAR(16));
CREATE TABLE IF NOT EXISTS keyword_templates (id BIGINT AUTO_INCREMENT PRIMARY KEY, business_id VARCHAR(64), keyword VARCHAR(255), keyword_code VARCHAR(64), cnt INT DEFAULT 0, FOREIGN KEY (business_id) REFERENCES industry_master(business_id));
